import Fullpage from "@fullpage/react-fullpage";
import './App.css';

function App() {
  return (
      <div>
        <Fullpage
            color
            render={()=>(
                <Fullpage.Wrapper>
                  <div className={"section"}>
                    <div className={"header"}>
                        <div>Home</div>
                        <div>Project</div>
                        <div>Rrogram</div>
                        <div>Address</div>
                    </div>
                    <div className={"box"}>
                        <div style={{
                            fontSize: 60
                        }}>YEONHO JEONG</div>
                        <div style={{
                            fontSize: 30,
                            color: "#009FBD",
                            marginTop: 25
                        }}>Creative Developer, Turn your thinking!</div>
                        <div style={{
                            fontSize: 25,
                            marginTop: 25
                        }}>I am not good at English. But very good at developing.<br/>People who don't see my talent are idiots.</div>
                    </div>
                    <div>
                        <div style={{
                            marginTop: "auto",
                            marginBottom: "auto"
                        }}>
                            <div>Project</div>
                        </div>
                    </div>
                  </div>
                  <div className={"section"}>
                    <p>ㅎㅇ2</p>
                  </div>
                </Fullpage.Wrapper>
            )}
        />
      </div>
  );
}

export default App;
